/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 trigger DelOnAsgExist
after delete on AssignmentExist
for each row 
begin
declare temp int;
set @name=old.AssignmentName;
set temp=(select @cnt=count(*) from AssignmentExist where AssignmentName=old.AssignmentName);
if( temp=0) then
	delete from `old.AssignmentName`;
end if;	
end */;;
